import { Breadcrumbs, Link, Typography } from '@mui/material';

function BreadCrumbsComponent() {
  return (
    <Breadcrumbs aria-label="breadcrumb">
      <Link underline="hover" color="inherit" href="/">
        HomePage
      </Link>
    </Breadcrumbs>
  );
}

export default Breadcrumbs;
